import React from "react";
import { Typography } from "@material-ui/core";
import Plan from "../images/code.svg";
export default function Market() {
  return (
    <div>
      <Typography variant="h4">This is the market section</Typography>
      <img
        alt="random"
        src={Plan}
        style={{ paddingTop: "3rem", maxWidth: "100%", height: "auto" }}
      />
    </div>
  );
}
